enum DiffItem<'a, A> {
    Add(&'a A),
    Update {
            old: &'a A,
            new: &'a A,
        },
    Remove(&'a A),
}

enum Entry<'a, K, V> where K: Ord + Clone, V: Clone {
    Occupied(OccupiedEntry),
    Vacant(VacantEntry),
}

enum DiffItem<'a, K, V> {
    Add(&'a K, &'a V),
    Update {
            old: (&'a K, &'a V),
            new: (&'a K, &'a V),
        },
    Remove(&'a K, &'a V),
}

fn intersection_with_key<B, C, F>(Self, HashMap<K, B, S>, F)
-> HashMap<K, C, S> where B: Clone, C: Clone, F: for<'_> FnMut(&'_ K, V, B) ->
C

enum Entry<'a, K, V, S> where K: Hash + Eq + Clone, V: Clone, S: BuildHasher {
    Occupied(OccupiedEntry),
    Vacant(VacantEntry),
}

enum FocusMut<'a, A> {
    Single(RRBPool<A>, &'a mut [A]),
    Full(RRBPool<A>, TreeFocusMut),
}
